import './dashboard.css';

const Dashboard = (props) => {
    const [tokenAddress, setTokenAddress] = useState('')
    return (
        <form>
            <div className="form-row"><label>Token Address</label><input type="text" value={tokenAddress} onChange={setTokenAddress}/></div>
            <div className="form-row btn-row"><input type="button" value="Get Token" className="btn"/></div>
        </form>
    );
}
